-- 테이블 ks.computer 구조 내보내기
CREATE TABLE IF NOT EXISTS `computer` (
  `computer_id` int(11) NOT NULL AUTO_INCREMENT COMMENT '컴퓨터 키값',
  `department_id` int(11) NOT NULL COMMENT '부서 키값',
